import React from "react";
import "../style.css"
import { 
    MDBCard,
    MDBCardBody,
    MDBCardHeader,
    MDBRow,
    MDBCol
 } from "mdb-react-ui-kit";
 import { ProfileCard } from "./card";




export function TableSection(props) {

    const {tableTitle} = props

     return(
         <MDBCard className="table-section">
             <MDBCardHeader >
                 {tableTitle}
             </MDBCardHeader>
             <MDBCardBody>
                 <MDBRow className="tableSection-body h-60">
                     <MDBCol>
                        <ProfileCard />
                     </MDBCol>
                 </MDBRow>
             </MDBCardBody>
         </MDBCard>
     )



}
